import React, { Component } from 'react';
import './style.css'

class Tab extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            newData:null,
            navList:['疫情地图','最新进展','广州疫情','直击现场']
        }
    }
    render() { 
        return (
            <div className="App">
                <div className="nav">
                    {
                        this.state.navList.map((item,index)=>{
                            return (
                                <div className="navItem">{item}</div>
                            )
                        })
                    }
                </div>
            </div>
        );
    }
}
 
export default Tab;
